import React from 'react';
import { Box, Typography, Card, CardContent } from '@mui/material';

const BackupRecovery: React.FC = () => {
  return (
    <Box>
      <Typography variant="h4" fontWeight={700} gutterBottom>
        Backup & Recovery
      </Typography>
      <Typography variant="body1" color="text.secondary" sx={{ mb: 4 }}>
        Manage system backup and recovery operations
      </Typography>

      <Card>
        <CardContent>
          <Typography variant="h6" gutterBottom>
            Backup & Recovery Interface
          </Typography>
          <Typography variant="body2" color="text.secondary">
            This page will contain the backup and recovery management interface.
            It will connect to the shared backend API at http://localhost:8013.
          </Typography>
        </CardContent>
      </Card>
    </Box>
  );
};

export default BackupRecovery;
